import React, { Fragment } from "react";
import classes from "./WelcomeText.module.css";

const WelcomeText = () => {
  return (
    <Fragment>
      <div className={classes.welcome__text}>
        <h1>connect</h1>
        <h1>share</h1>
        <h1>cheer</h1>
      </div>
    </Fragment>
  );
};

export default WelcomeText;
